// thêm thư viện 
import express from "express";
import bodyParser from "body-parser"; // hỗ trợ cho chúng ta lấy được các tham số 
// thêm các hàm
import viewEngine from "./config/viewEngine";
import initWebRoutes from "./route/web";
import connectDB from "./config/connectDB";

// để use câu lệnh process.env.PORT 
require('dotenv').config();

// tạo biến app
let app = express();

// config(cấu hình) app 
// cấu hinh các tham số từ colieng gửi lên
app.use(bodyParser.json())
app.use(bodyParser.urlencoded({ extended: true })) //undefined mã hóa 

// gọi hàm
viewEngine(app);
initWebRoutes(app);

connectDB();

// tạo PORT (process.env.PORT lấy trong file env)
let port = process.env.PORT || 6969; // nếu cái PROT của ta không hoạt động sẻ dùng || để chạy cổng khác

// chạy app 
app.listen(port, () => {
    // sau khi chạy thành công in ra màng hình
    console.log("backend Nodejs is runing on the port " + port)

})

