// thêm các thư viện vào 
import express from "express"


// tao mot function ES6 cu phat moi
// let là khai báo trong phạm vi file đang làm thôi 
let configViewEngine = (app) => {
    // cấu hình app (static là đường link dẫn tới thư mục của chúng ta)
    app.use(express.static("./src/public"))
    app.set("view engine ", "ejs"); //ejs cho phép chúng ta gõ được câu lệnh for esle if trong html
    app.set("views", "./src/views")

}

// xuất file
module.exports = configViewEngine;

