sourcesContent:
import { query } from "express";
import db from "../models/index"
import CRUDService from "../services/CRUDservice";
// tạo function
let getHomePage = async (req, res) => {
    try {
        let data = await db.User.findAll();// findAll là in tất cả ra 
        // sử dụng hàm render ra file ejs 

        return res.render('homepage.ejs', {
            data: JSON.stringify(data)
        });
    } catch (e) {
        console.log(e)
    }

}
let getAboutPage = (req, res) => {
    return res.render('test/about.ejs')
}

let getCRUD = (req, res) => {
    return res.render('test/crud.ejs')
}

let postCRUD = async (req, res) => {
    let message = await CRUDService.createNewUser(req.body);
    console.log(message)
    return res.send('post crud from server');
}

let displayGetCRUD = async (req, res) => {
    let data = await CRUDService.getAllUser()
    console.log('-------------------------')
    console.log(data)
    console.log('-------------------------')

    return res.render('test/displayCRUD.ejs', {
        dataTable: data
    })
}

let getEditCRUD = async (req, res) => {
    let userId = req.query.id;
    // lay duoc Id tren url
    console.log(req.query.id);
    if (userId) {
        let uesrData = await CRUDService.getUserInfoById(userId);
        console.log('----------------------------------------------')
        console.log(uesrData)
        console.log('----------------------------------------------')

        // check user data not found

        // let uesrData
        return res.render('test/editCRUD.ejs', {
            user: uesrData,
        })

    }
    else {
        return res.send('Users not found')

    }
}

let putCRUD = async (req, res) => {
    let data = req.body;// lay duoc tat ca body
    let allUser = await CRUDService.updateUserData(data);
    return res.render('test/displayCRUD.ejs', {
        dataTable: allUser
    })
}

let deleteCRUD = async (req, res) => {
    // lấy ra id
    let id = req.query.id;
    if (id) {
        await CRUDService.deleteUserById(id);
        return res.send('delete the user succeed')
    } else {
        return res.send('user not found ')
    }

}
// xuất ra ngoai nhiều 
module.exports = {
    getHomePage: getHomePage,
    getAboutPage: getAboutPage,
    getCRUD: getCRUD,
    postCRUD: postCRUD,
    displayGetCRUD: displayGetCRUD,
    getEditCRUD: getEditCRUD,
    putCRUD: putCRUD,
    deleteCRUD: deleteCRUD,

}

